import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { makeStyles, Divider } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: theme.palette.background.dark,
    display: 'flex',
    // height: '100%',
    overflow: 'hidden',
    width: '100%',
    paddingTop: "10%"
  },
  wrapper: {
    display: 'flex',
    flex: '1 1 auto',
    overflow: 'hidden',
    paddingTop: 64,
  },
  contentContainer: {
    display: 'flex',
    flex: '1 1 auto',
    overflow: 'hidden'
  },
  content: {
    flex: '1 1 auto',
    height: '100%',
    overflow: 'auto'
  },

  footer: {
    width: "100%",
    margin: "auto",
    padding: "0 0 1.5rem 0"
  },
  footer_descript: {
    textAlign: "center",
    fontWeight: 200,
  },
  footer_ment: {
    padding: 4,
    fontSize: 12
  },
  footer_image: {
    textAlign: "center",
    marginTop: 20,
    marginBottom: 20
  },
  footer_divider: {
    marginTop: 50
  }
}));

const DashBoardFooterLayout = () => {
  const classes = useStyles();
  return (
    <footer className={classes.footer}>
      <Divider className={classes.footer_divider}/>
      <div className={classes.footer_image}>
        {/* <img src={TobelongLogo} /> */}
      </div>
      <div className={classes.footer_descript}>
        <div className={classes.footer_ment}>제공 서비스 : SOTHECODE_ERP ㅣ 회사명 : SOTHECODe</div>
        <div className={classes.footer_ment}>Disclaimer: All content is provided for fun and entertainment purposes only</div>
        <div className={classes.footer_ment}>ⓒ 2021. 소더코드 .All Rights Reserved.</div>
      </div>
    </footer>
  );
};

DashBoardFooterLayout.propTypes = {
  children: PropTypes.node
};

export default DashBoardFooterLayout;
